        // Oscillatory/resonant
        this.variables.set('k', 1e20);                          // m^-2�
        this.variables.set('omega_osc', 1e15);                  // rad/s
        this.variables.set('x', 0.0);                           // m
        this.variables.set('A', 1e-10);                         // Amplitude
        
        // Quantum
